/* dropdown modify */

.dropdown-base {
  width: 61.85vw;
  height: 9.76vw;
  font-size: 4.27vw;
  color: white;
  background: var(--color-background);
  border: 1px solid var(--color-border);
  border-radius: 5px;
  overflow: hidden;
  position: relative;
  display: flex;
  justify-content: center;
  align-items: center;
  margin-bottom: 4.88vw;
  transition: all 0.2s;
}

.dropdown-base:hover{
  border: 1px solid #a7a6a6;
}

.dropdown-base .select {
  width: 100%;
  height: 2.562vw;
  background: url("../images/downarrow.svg") no-repeat;
  background-position: 95% center;
  display: flex;
  align-items: center;
  justify-content: center;
}

.dropdown-base .select select {
  color: var(--color-body-darker);
  background: transparent;
  border: 0;
  padding: 0;
  border-radius: 0;
  width: 100%;
  position: relative;
  z-index: 1;
  font-size: 1em;
  outline: none;
  padding-left: 2.562vw;
}
/* hide dorpdown downarrow */

select {
  -moz-appearance: none;

  -webkit-appearance: none;
}

select::-ms-expand {
  display: none;
}

@media screen and (min-width: 820px) {
  .dropdown-base {
    width: 250px;
    height: 33px;
    font-size: 16px;
    margin-bottom: 10px;
  }

  .dropdown-base .select {
    height: 10px;
  }
  .dropdown-base .select select {
    padding-left: 10px;
  }
}

/* table */

.table-base {
  width: 100%;
  height: 57.78vw;
  border: 1px solid var(--color-border);
  border-radius: 10px;
  overflow-y: auto;
}

.table {
  width: 100%;
  padding: 3.66vw 2.44vw 2.44vw 2.44vw;
  text-align: left;
}

.table__head {
