  padding-bottom: 2.44vw;
}

.table .product {
  padding-left: 2.44vw;
  width: 49%;
}

.table .uom {
  width: 17%;
  text-align: center;
}

.table .qty {
  width: 17%;
  text-align: center;
}

.table .note {
  text-align: center;
}

.empty-note {
  text-align: center;
  font-size: 3.44vw;
  font-weight: 300;
  margin-top: 6vw;
  
}

@media screen and (min-width: 820px) {
