/* popup icon */

.btn-popup {
  outline: 0;
  background: none;
  border: 0;
  padding: 0;
  margin: 0;
  cursor: pointer;
}

.popup {
  width: 6.1vw;
  height: 6.1vw;
}

.popup g {
  fill: var(--color-body-darker);
}

.popup--blur g {
  fill: #0000ff;
}

.btn--order  .popup g {
  fill: #111;
}

.btn--order .popup {
 padding-right: 1vw;
}

/* note input */
.note-input {
  outline: none;
  width: 100%;
  min-height: 35px;
  height: 35px;
  max-height: 100px;
  border: 1px solid var(--color-border);
  border-radius: 5px;
  text-align: left;
  resize: vertical;
  outline: none;
  padding: 5px;
  font-size: 1.6rem;
  transition: all 0.2s;
}

.note-input:hover{
  border: 1px solid #a7a6a6;
}



.note-output{
  margin: 0;
  padding: 5px;
  font-size: 1.6rem;
  display: inline-block;
}

@media screen and (max-width: 819px) {
  .note-input,.note-output {
    display: none;
  }
  
}

